export default function SignUp() {
  return (
    <div className="parent">
      <div className="register">
        <form>
          <label htmlFor="name">Name:</label>
          <input id="name" type="text" placeholder="Enter Your Name..." />
					<label htmlFor="email">Email:</label>
        </form>
      </div>
    </div>
  );
}
